{% extends 'base.html.twig' %}

{% block title %}Ajouter une Promotion{% endblock %}

{% block stylesheets %}
<link rel=\"stylesheet\" href=\"https://cdnjs.cloudflare.com/ajax/libs/select2/4.0.12/css/select2.min.css\">


{% endblock %}

{% block body %}
{% if app.user %}


    <div class=\"container-fluid\" >
        <div class=\"row\">
            <div class=\"col-xl-10 col-lg-9 col-md-8 ml-auto mb-5 mt-5\">

                {% include \"editor/promotion/_nav_promotion.html.twig\" with {'p':1} %}

                <div class=\"my-5\">

                    <!-- afficher le formulaire d'ajout d'une promotion -->
                    <h4  class=\"btn btn-info btn-sm\">Créer une Promotion</h4>
                    {{ form_start(form) }}
                    {{ form_widget(form) }}
                    <button class=\"btn btn-outline-danger d-block ml-auto\">Enregistrer</button>
                    {{ form_end(form) }}

                </div>

            </div>
        </div>
    </div>
{% endif %}
{% endblock %}



{% block javascripts %}
<script src=\"https://cdnjs.cloudflare.com/ajax/libs/select2/4.0.12/js/select2.min.js\"></script>
<script>
    \$('select').select2();
</script>
{% endblock %}", "editor/promotion/promo_new.html.twig", "/var/www/html/احتياط/FabriqueAdmin5/templates/editor/promotion/promo_new.html.twig");
